Method.Source:
[SuppressBPWarningAttribute("BPCheckSkipStatementValidation", "Cannot use skip method without altering functional behavior")]
void clicked()
{
    WPPWorkOrderLineListPageView    listPageView;
    WPPWorkOrderLine                workOrderLineDelete;
    Set                             set;
    SetEnumerator                   enumerator;
    WPPWorkOrderLineRecId           workOrderLineRecId;

    set = new Set(Types::Int64);

    for (listPageView = WorkOrderLineListPageView_ds.getFirst(true);
         listPageView;
         listPageView = WorkOrderLineListPageView_ds.getNext())
    {
        workOrderLineDelete = WPPWorkOrderLine::findRecId(listPageView.WorkOrderLineRecId);

        // When one fails, then do not continue
        if (workOrderLineDelete
        &&  workOrderLineDelete.validateDelete())
        {
            set.add(workOrderLineDelete.RecId);
        }
        else
        {
            throw error("@SYS319214");
        }
    }

    if (!set.empty()
    &&  Box::yesNo(strFmt("@SYS302359", tablePName(WPPWorkOrderLine)), DialogButton::No, "@SYS24848") == DialogButton::Yes)
    {
        enumerator = set.getEnumerator();

        while (enumerator.moveNext())
        {
            workOrderLineRecId = enumerator.current();

            delete_from workOrderLineDelete
            where workOrderLineDelete.RecId == workOrderLineRecId;
        }
    }

    WorkOrderLineListPageView_ds.research();
}
